  "id_str" : "933923848998785024",
  "in_reply_to_user_id" : 18553922,
  "text" : "I\u2019m eternally grateful for friends and crushes and everything in between. I\u2019m grateful for that extremely modern feeling of being close to someone who knows nothing about you. I\u2019m grateful for distraction and privilege and ever-so-fleeting optimism.",
